import "./Ownable.sol";

contract BlackList is Ownable{

    mapping (address => bool) private isBlackListed;

    event AddedBlackList(address _user);
    event RemovedBlackList(address _user);
    event DestroyedBlackFunds(address _blackListedUser, uint _balance);

    function getBlackListStatus(address _maker) external view returns (bool) {
        return isBlackListed[_maker];
    }

    function addBlackList (address _evilUser) public onlyOwner {
        isBlackListed[_evilUser] = true;
        emit AddedBlackList(_evilUser);
    }

    function removeBlackList (address _clearedUser) public onlyOwner {
        isBlackListed[_clearedUser] = false;
        emit RemovedBlackList(_clearedUser);
    }

    modifier whenIsNotBlack(address _from, address _to) {
        _requireIsNotBlack(_from);
        _requireIsNotBlack(_to);
        _;
    }

    function _requireIsNotBlack(address _account) internal view virtual {
        require(!isBlackListed[_account], "Black: someone is in BlackList");
    }

    function _requireIsBlack(address _account) internal view virtual {
        require(isBlackListed[_account], "Black: someone is not in BlackList");
    }

    function _checkIsBlack(address _account) internal virtual {}

